import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
   faArrowRight,
   faArrowLeft,
} from '@fortawesome/free-solid-svg-icons';

import Button from 'components/commons/Button/Button';

import styles from './GarageControlPanel.module.scss';

function GarageControlPanel() {

   return(
      <div className = { styles.panel }>
         {/* <aside className = { styles.aside }> */}
            <Button style = { styles.bigButton } name = { <p>Generate <br />  Cars</p> } />
         {/* </aside> */}
         <aside className = { styles.aside }>
            <div className = { styles.row }>
               <input placeholder = "Create Car"/>
               <input type = "color" name = "create car color"/>
               <Button name = "Create" />
            </div>
            <div className = { styles.row }>
               <input placeholder = "Update Car"/>
               <input type = "color" name = "create car color"/>
               <Button name = "Update" />
            </div>
         </aside>
         <aside className = { styles.aside }>
            <h2 className = { styles.title }>GARAGE (104 cars)</h2>
            <div className = { styles.row }>
               <Button name = { <FontAwesomeIcon icon = { faArrowLeft } /> }/>
               <p>Page #13</p>
               <Button name = { <FontAwesomeIcon icon = { faArrowRight } /> }/>
            </div>
         </aside>
         
      </div>
   )
}

export default GarageControlPanel;
